  false,\n\t\"url\": null,\n\t\"notes\": \"Two species of terns breed commonly on
  Malheur National Wildlife Refuge. The Forster's tern, Sterns forsteri, nests colonially
  in the center of Malheur Lake and forages up the Blitzen and Silvies River valleys.
  The Black Tern, Childonias niger, nests in smaller colonies in marshes throughout
  the refuge. This study attempts to compare their foraging behavior, prey selection,
  and foraging efficiency, and evaluates the possibility of competition for food.\",\n\t\"owner_org\":
